INSERT INTO `order_notification_templates` VALUES (1,'new','<p>Здравствуйте, [fio]!<br>Ваш заказ оформлен.<br>После внесения предоплаты, заказ будет запущен в работу. &nbsp;<br><br>Высылаем Вам наряд заказ.<br><strong>Общая стоимость:&nbsp; [total] руб.</strong><br><strong>Скидка: [discount]%</strong><br><strong>Итого с учетом скидки: [totalDiscount] руб.</strong><br><br>Предоплата 50%&nbsp;<br><strong>Предоплата:&nbsp; [totalDiscount50] руб.</strong></p><p><br>Остаток 50% после изготовления(пришлем фото готовых изделий)</p><p><strong>Сбербанк, номер карты:</strong><br><strong>2202 2061 9867 3670</strong></p><p>Ковыршин Кирилл Анатольевич</p><p>Внесением денежных средств Вы согласуете макет печати.<br><br>Адрес доставки:&nbsp;<br><br><strong>[address]</strong><br><br>P.S. Обязательно подписывайтесь на канал нашего песика по имени Чиф. Это талисман нашей мастерской: <a href=\"https://t.me/Chief_JRT\">https://t.me/Chief_JRT</a>&nbsp;<br>--</p><p><img src=\"https://crm.3dwolf.ru/storage/files/Logo.Wolf.png_1684476800.png\"><br>С уважением,&nbsp;<br><strong>3DWolf</strong><br>Печать и моделирование</p><p><a href=\"https://3dwolf.ru\"><strong>https://3dwolf.ru</strong></a><strong>&nbsp;</strong></p><p>+74991131423&nbsp;<br>Telegram: <a href=\"https://t.me/oxyfire\">@oxyfire</a><br>WhatsApp: <a href=\"https://wa.me/79691421429\">+7 969 142 142 9</a></p><p><strong>Мастерская:</strong><br>Долгопрудный, Московское шоссе 57А</p><p><br><strong>ПВЗ Бауманская:</strong><br>Москва, Переведеновский пер. стр 2</p>','Ваш заказ прошел оформление. На почте наряд-заказ','2023-05-19 05:50:18','2023-07-13 05:04:41'),(2,'printing','<p>Здравствуйте, [fio]!</p><p><br>Ваш статус заказа на 3D печать изменился на: <strong>[status]</strong></p><p><br>По готовности мы сообщим Вам о возможности его забрать.&nbsp;</p><p>P.S. Обязательно подписывайтесь на канал нашего песика по имени Чиф. Это талисман нашей мастерской: <a href=\"https://t.me/Chief_JRT\">https://t.me/Chief_JRT</a>&nbsp;</p><p>--</p>